script: |
  super -f text -I q5347.spq | sort > q5347.out

inputs:
  - name: q5347.spq
    data: |
      SELECT DISTINCT 67 * - col2 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 43 NOT BETWEEN - - col2 * + ( - col2 ) + CAST ( + col1 AS INTEGER ) AND ( - col1 + + col0 + 34 * + ( - col1 ) );
  - name: tab2

outputs:
  - name: q5347.out
    data: |
